import React from "react";

function PageError() {
  return (
    <>
      <h1> Sorry...Page not found </h1>
      <img  alt ="img" src="https://freefrontend.com/assets/img/html-funny-404-pages/HTML-404-Error-Page.gif" />
      <button>Go back</button>
    </>
  );
}
 export default PageError;
